   import React,{Component} from 'react';


function TopNavLeftIcons(props) {
     
    return (
        <ul class="list-inline hover-red">
            <li><a href="https://www.facebook.com/" title="Facebook" target="_blank">
                <i className={'props.icon'}></i></a>
            </li>
        </ul>
    );
    
}
export default TopNavLeftIcons;
